import '../App.css'
import flechaBack from '../imagenes/iconos/next.png'
const BackBar=()=>
{
    return(
        <div>
            <div>
                <span>
                    <img src={flechaBack}/>
                </span>
            </div>
        </div>
    )
}
export default BackBar;
